import React, { Component } from 'react';
import "./css/styles.css";
import "./css/w3schools.css";


export default class AboutMe extends Component {
  render() {
    return (
      <div id="aboutme">
      <h3 class="main montserrat large"> ABOUT ME </h3>
      <p class="main montserrat medium">I'm a sophomore at Harvard College studying Computer Science likely with a minor in Economics. My interests lie at the intersection of tech and business. I believe with the tools of technology we can work to solve societal problems and what excites me most is the prospect of being a part of this. using my skills in CS to help solve societ  I'm excited by the    In my free time, I enjoy playing squash, French horn, studying Spanish, and traveling.  </p>
      </div>
    )
  }
}
